import React from 'react'
// import {useState} from 'react';


function ShowAllData(Data) {
    const info={Data};
    console.log(info);
  return (
    <>
    <table>
        <thead>
            <td>Name</td>
            <td>Enrollment no.</td>
            <td>Class</td>
        </thead>
        <tbody>
            {
                info.map((current,index)=>{
                    return(<>
                      <tr key={index}>
                    <td>{current.userName}</td>
                    <td>{current.userEnrollment}</td>
                    <td>{current.userClass}</td>
                </tr>
                    </>)
                })
                
            }
        </tbody>
    </table>
    </>
  )
}

export default ShowAllData
